class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function incremovableSubarrayCount($nums) {
        $n = count($nums);
        $left = array_fill(0, $n, 0);
        $right = array_fill(0, $n, 0);
        $stack = [];

        for ($i = 0; $i < $n; ++$i) {
            while (!empty($stack) && $nums[$stack[count($stack) - 1]] >= $nums[$i]) {
                array_pop($stack);
            }
            $left[$i] = empty($stack) ? -1 : $stack[count($stack) - 1];
            $stack[] = $i;
        }

        $stack = [];
        for ($i = $n - 1; $i >= 0; --$i) {
            while (!empty($stack) && $nums[$stack[count($stack) - 1]] > $nums[$i]) {
                array_pop($stack);
            }
            $right[$i] = empty($stack) ? $n : $stack[count($stack) - 1];
            $stack[] = $i;
        }

        $result = 0;
        for ($i = 0; $i < $n; ++$i) {
            $result += ($i - $left[$i]) * ($right[$i] - $i);
        }

        return $result;
    }
}
